requests.tests:
if (responseCode.code != 200) {
    tests["Start Spark call: failed"] = false;
}
else {
    tests["Start Spark call: success"] = true;

    var xmlData = xml2Json(responseBody);
    console.log(xmlData);
    if (!xmlData) {
        tests["Start Spark call: parseing response as XML"] = false;
    }
    else {
        tests["Start Spark call: parseing response as XML"] = true;
        if ((!xmlData.Command) || (!xmlData.Command.DialResult) || (!xmlData.Command.DialResult.CallId)) {
            tests["Start Spark call: checking XML payload"] = false;
        }
        else {
            tests["Start Spark call: checking XML payload"] = true;

            var callId = xmlData.Command.DialResult.CallId;
            postman.setEnvironmentVariable("_call", callId);
            tests["Start Spark call: retreived Call with id:" + callId] = true
        }
    }
}

